import mongoose from "mongoose";

const userSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
  },
  email: {
    type: String,
    required: true,
    unique: true,
  },
  password: {
    type: String,
    required: true,
  },

  // usermodel.js (schema snippet)
  address: {
    type: Object,
    default: () => ({ line1: "", line2: "" }),
  },

  gender: {
    type: String,
    default: "Not Selected",
  },
  phone: {
    type: String,
    default: "+91 0000000000",
  },
  dob: {
    type: Date,
    default: () => new Date("2004-01-01"),
  },
  image: {
    type: String,
    default:
      "data:image/png;base64,",
  },
});

const usermodel = mongoose.models.user || mongoose.model("user", userSchema);
export default usermodel;
